Sure, below is the code for a basic port scanner written in Go:

```go
package main

import (
    "fmt"
    "net"
    "strconv"
    "time"
)

func main() {
    address := "scanme.nmap.org"
    timeout := time.Millisecond * 500

    scanPorts(address, timeout)
}

func scanPorts(addr string, timeout time.Duration) {
	fmt.Printf("Scanning ports of %v\n", addr)

	for i := 1; i <= 1024; i++ {
		target := addr + ":" + strconv.Itoa(i)

		conn, err := net.DialTimeout("tcp", target, timeout)
		if err == nil {
  	           fmt.Printf("[+] %v Open\n", target)
    	       defer conn.Close()  
	    }
	}
	fmt.Println("Scanning Completed.")
}
```

